let instructions = `



`;

function getNumberLevel(number) {
  if(number == 1)
    return 2;
  else if(number >= 2 && number <= 4)
    return 1;
  else if(number >= 5 && number <= 9)
    return 0;
  else if(number >= 10 && number <= 12)
    return -1;
  else if(number == 13)
    return -2;
}

function getLevelLength(level) {
  return 5-Math.abs(level)*2;
}

function getNextNumber(number, direction) {
  let level = getNumberLevel(number);
  let levelLength = getLevelLength(level);
  let nextNumber;

  let levelCheck = false;

  if(direction == 'U') {
    nextNumber = number - (4-Math.abs(levelLength)*2);
    levelCheck = Math.abs(level - Math.abs(getNumberLevel(nextNumber))) == 1;
  } else if(direction == 'D') {
    nextNumber = number + (4-Math.abs(levelLength)*2);
    levelCheck = Math.abs(level - Math.abs(getNumberLevel(nextNumber))) == 1;
  } else if(direction == 'R') {
    nextNumber = number+1;
    levelCheck = level == getNumberLevel(nextNumber);
  } else if(direction == 'L') {
    nextNumber = number-1;
    levelCheck = level == getNumberLevel(nextNumber);
  }

  return levelCheck ? nextNumber : number;
}

instructions = instructions.split("\n");
let code = [];

let startingNumber = 5;
for(let sequence in instructions) {
  let steps = instructions[sequence].split('');

  let number = startingNumber;
  for(let step in steps) {
    number = getNextNumber(number, steps[step]);
  }

  code.push(number.toString(14));
  startingNumber = number;
}

console.log(code.join(''));